/* Explanations at junerockwell.com */
let canvas, context;
let mainImage = null;
let star_img = null;
let previewImage = null;
let isDraggable = false;

let currentX = 0;
let currentY = 0;
let currentA = 0;
let currentB = 0;

// window.onload = function() {
const init = () => {
  canvas = document.getElementById("canvas");
  context = canvas.getContext("2d");

  mainImage = new Image();
  star_img = new Image();
  // currentX = canvas.width;
  // currentY = canvas.height;

  // currentX = canvas.width - 100;
  // currentY = canvas.height - 100;

  mainImage.onload = function() {
    currentX = mainImage.width - 120;
    currentY = mainImage.height - 60;
    _Go();
  };
  //star_img.src = "data:image/png;base64,";
  // star_img.src='data:image/png;base64,';
  // star_img.src='data:image/png;base64,';
  star_img.src = 'data:image/png;base64,';
  mainImage.src = previewImage;
};

function _Go() {
  _MouseEvents();

  setInterval(function() {
    _ResetCanvas();
    _DrawImage();
  }, 1000/30);
}
function _ResetCanvas() {
  context.fillStyle = '#fff';
  context.fillRect(0,0, canvas.width, canvas.height);
}
function _MouseEvents() {
  canvas.onmousedown = function(e) {

    let mouseX = e.pageX - this.offsetLeft;
    let mouseY = e.pageY - this.offsetTop;

    if (mouseX >= (currentX - star_img.width/2) &&
      mouseX <= (currentX + star_img.width/2) &&
      mouseY >= (currentY - star_img.height/2) &&
      mouseY <= (currentY + star_img.height/2)) {
      isDraggable = true;
      //currentX = mouseX;
      //currentY = mouseY;
    }
  };
  canvas.touchstart = function(e) {
    console.log('mvldfmlv');
    let mouseX = e.pageX - this.offsetLeft;
    let mouseY = e.pageY - this.offsetTop;


    if (mouseX >= (currentX - star_img.width/2) &&
      mouseX <= (currentX + star_img.width/2) &&
      mouseY >= (currentY - star_img.height/2) &&
      mouseY <= (currentY + star_img.height/2)) {
      isDraggable = true;
      //currentX = mouseX;
      //currentY = mouseY;
    }
  };
  canvas.onmousemove = function(e) {

    if (isDraggable) {
      currentX = e.pageX - this.offsetLeft;
      currentY = e.pageY - this.offsetTop;
    }
  };
  canvas.onmouseup = function(e) {
    isDraggable = false;
  };
  canvas.onmouseout = function(e) {
    isDraggable = false;
  };
}
function _DrawImage() {
  canvas.width = mainImage.width;
  canvas.height = mainImage.height;
  context.drawImage(mainImage, 0, 0, mainImage.width, mainImage.height);

  context.drawImage(
    star_img,
    currentX - (star_img.width / 2),
    currentY - (star_img.height / 2)
  );
  // context.drawImage(star_img, currentX-(star_img.width/2), currentY-(star_img.height/2));
}

document.getElementById('readUrl').addEventListener('change', function(){
  const image = this.files[0];
  if (image) {
    const reader = new FileReader();
    reader.readAsDataURL(image);
    reader.onload = e => {
      previewImage = e.target.result;
      init();
    };
  }
});